import React, { useState } from "react";
import WeatherItem from "./WeatherItem";

const WeatherList = (props) => {
  return (
    <ul>
      {props.items.map((weather) => (
        <WeatherItem
          id={weather.id}
          name={weather.name}
          coun={weather.coun}
          temp={weather.temp}
          status={weather.status}
        />
      ))}
    </ul>
  );
};

export default WeatherList;
